// --- Flattened view: most recent year per district ---

export const MOCK_DISTRICTS: DistrictProfile[] = DISTRICT_FIXTURES.map((entry) => {
  const d = entry.district;
  const latest = entry.years[entry.years.length - 1];
  return {
    districtId: d.id,
    name: d.name,
    cdsCode: d.cdsCode,
    state: d.state || 'CA',
    location: `${d.city || ''}, ${d.state || 'CA'}`,
    county: d.county || '',
    street: d.street || undefined,
    city: d.city || undefined,
    zip: d.zip || undefined,
    phone: d.phone || undefined,
    website: d.website || undefined,
    latitude: d.latitude ?? undefined,
    longitude: d.longitude ?? undefined,
    superintendentFirstName: d.superintendentFirstName || undefined,
    superintendentLastName: d.superintendentLastName || undefined,
    docType: d.docType || undefined,
    statusType: d.statusType || undefined,
    ncesDistrictId: d.ncesDistrictId || undefined,
    academicYear: latest?.academicYear || '',
    gradeServed: latest?.gradeServed || undefined,
    lowGrade: latest?.lowGrade || undefined,
    highGrade: latest?.highGrade || undefined,
    numberOfSchools: latest?.numberOfSchools ?? undefined,
    totalEnrollment: latest?.totalEnrollment ?? 0,
    studentSpending: latest?.studentSpending ?? undefined,
    ellPercentage: latest?.ellPercentage ?? undefined,
    totalEll: latest?.totalEll ?? undefined,
    frpmCount: latest?.frpmCount ?? undefined,
    frpmEnrollment: latest?.frpmEnrollment ?? undefined,
    spedCount: latest?.spedCount ?? undefined,
    chronicAbsenteeismRate: latest?.chronicAbsenteeismRate ?? undefined,
    elaProficiency: latest?.elaProficiency ?? undefined,
    mathProficiency: latest?.mathProficiency ?? undefined,
  };
});

// --- Extended type and helper functions ---

export interface DistrictListItem extends DistrictSummary {
  county: string;
}

export function getMockDistrictListItems(): DistrictListItem[] {
  return MOCK_DISTRICTS.map((d) => ({
    districtId: d.districtId,
    name: d.name,
    state: d.state,
    location: d.location,
    enrollment: d.totalEnrollment,
    county: d.county,
  }));
}

export function getMockCountyFilters(): FilterFacet {
  const countyCounts = new Map<string, number>();
  MOCK_DISTRICTS.forEach((d) => {
    countyCounts.set(d.county, (countyCounts.get(d.county) || 0) + 1);
  });

  const options: FilterOption[] = Array.from(countyCounts.entries())
    .sort(([a], [b]) => a.localeCompare(b))
    .map(([county, count]) => ({
      value: county,
      label: `${county} (${count})`,
      count,
    }));

  return {
    filterName: 'county',
    filterLabel: 'County',
    options,
  };
}

export function getMockDistrictSummaries(): DistrictSummary[] {
  return MOCK_DISTRICTS.map((d) => ({
    districtId: d.districtId,
    name: d.name,
    state: d.state,
    location: d.location,
    enrollment: d.totalEnrollment,
  }));
}

// --- Multi-year data accessor (for future trend charts) ---

export function getDistrictYearData(districtId: string): DistrictYearData[] {
  const entry = DISTRICT_FIXTURES.find((e) => e.district.id === districtId);
  if (!entry) return [];
  return [...entry.years].sort((a, b) => a.academicYear.localeCompare(b.academicYear));
}
